    [],nt"revision_timestamp": "2016-07-27T22:55:31.118042",nt"name": "long-lake-national-wildlife-refuge-long-lake-wetland-management-district-annual-narrative-",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Long Lake
    NWR, Long Lake WMD, and the easement refuges outlines Refuge accomplishments during
    the 1985 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, grazing, haying, fire management, pest control,
    and WPA easements. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, fisheries resources, animal control, marking and bird banding,
    and disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, and energy conservation. Cooperative
    programs are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
